public boolean equals(Object o) {
  if (this == o) {
    return true;
  }
  if (o == null || getClass() != o.getClass()) {
    return false;
  }
  LocalFileSystemPathHandle that = (LocalFileSystemPathHandle) o;
  return Objects.equals(path, that.path) &&
      Objects.equals(mtime, that.mtime);
}
